import React from "react";
import { Link } from "react-router-dom";
import logo from "../logo.svg";

const NavBar = () => {
  return (
    <nav>
      <img src="src\img\pokemon.png" alt="Pokemon" />
      <Link className="navbar-brand text-primary" to="/">
        Pokedex
      </Link>
    </nav>
  );
};

export default NavBar;
